import { FormProvider, useForm } from 'react-hook-form'; // Importe o useForm

const LoginPage: React.FC = () => {
    const formMethods = useForm(); // Obtenha os métodos de formulário

    const handleSubmit = (data: any) => {
        // Trate os dados aqui conforme necessário
        window.location.reload();
    };

    return (
        <FormProvider {...formMethods}> {/* Passe formMethods como um valor para FormProvider */}
            <FormLogin onSubmit={handleSubmit} buttonText="Login" /> {/* Passe o handleSubmit como prop para FormLogin */}
        </FormProvider>
    );
}

export default LoginPage;
